contract Loop{



    function loops() external pure {
        for (uint i = 0; i < 10 ;i++){
            if (i == 3){
                continue; 
            }
            if (i == 5){
                break ;
            }
        }
    }
       function sum(uint _n)external  pure returns (uint){
           uint s;
           for(uint i = 1; i <= _n; i++){
               s += i;
           }
           return s;
       }
    }

